import React from 'react';
import p from './Dialogs/Dialog.module.css';
import { NavLink } from 'react-router-dom';

const Paf = () => {
  return (
    <div className={p.item}>
      <div className={p.dialog} onClick={this.addHref}>
        <NavLink exact to='/paf'>
          Sasha
        </NavLink>
      </div>
    </div>
  );
};

export default Paf;
